import "./project-page.css";
import { useState } from "react";

function ProjectPage() {
  let [project, setProject] = useState(projectList);
  function addNewProject() {
    console.log("asd");
    setProject(newProjectList);
  }

  const projectList = (
    <div className="project-list">
      <h5>Project name</h5>
      <h5>Date</h5>
      <h5>stage in working or completed</h5>
      <h5>Dead line</h5>
      <h5>Mark as completed</h5>
    </div>
  );

  const newProjectList = (
    <div className="project-list">
      <input type="text" value="Project name"></input>
      <input type="text" value="Date"></input>
      <input type="text" value="In Progress"></input>
      <input type="text" value="Dead line"></input>
      <input type="submit" value="Add"></input>
    </div>
  );

  return (
    <div className="project-container">
      <div className="project-menu">
        <div>sort by</div>
        <div>Add new project</div>
        <div className="button" onClick={addNewProject}>
          Add project
        </div>
      </div>
      {project}
    </div>
  );
}

export default ProjectPage;
